$\textbf{Mga Lumang Lugar ni Juan sa Pagkolekta ng Selyo}$

Inaayos ni Juan ang mga selyo sa kanyang koleksyon ayon sa bansa at dekada kung kailan ito inilabas. Ang mga presyo na binayaran niya para sa mga ito sa isang tindahan ng selyo ay: Brazil at France, $6$ sentimos bawat isa, Peru $4$ sentimos bawat isa, at Spain $5$ sentimos bawat isa. (Ang Brazil at Peru ay mga bansa sa Timog Amerika at ang France at Spain ay nasa Europa.) [asy]
