original_question:
Ang tatsulok na $ABC$ ay isosceles, kung saan $AB=AC$ at ang altitude $AM=11.$ Ipagpalagay na may isang punto $D$ sa $\overline{AM}$ na may $AD=10$ at $\angle BDC=3\angle BAC.$ Hanapin ang perimeter ng tatsulok na $ABC.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

