original_question:
Ang isang parihabang bukid ay napapalibutan ng isang athletic track, tulad ng ipinapakita sa ibaba. Ang track ay binubuo ng dalawang gilid ng bukid, at dalawang kalahating bilog. Ang haba ng track ay 400 metro. Ano ang pinakamalaking posibleng sukat ng bukid, sa metro kuwadrado?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

